import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const root = createRoot(document.getElementById('root'));

root.render(
<Auth0Provider
    domain="dev-8slp8hxow0zqx666.us.auth0.com"
    clientId="Y2BlQACpQpRTOXrq7RB4ma06IpheOvrS"
    authorizationParams={{
      redirect_uri: window.location.origin
    }}
  >
    <App />
  </Auth0Provider>,
);
